import {Container, Row, Col} from 'react-bootstrap';

const footer = () => {
  return (
    <footer>
        <Container>
            <Row>
                <Col md={12}>
                    <span className='text-center'>Copyright &copy; Anand-Singh-techie</span>
                </Col>
            </Row>
        </Container>
    </footer>
  )
}

export default footer
